                            </Col>
                        })
                    } */}

{resdata &&
    resdata.map((element, index) => (
        <Col lg={4} md={6} key={index}>
            <div className='card-par'>
                <Cards resName={element.resName} photographs={element.photographs} neighborhood={element.neighborhood} location={element.location} index={index} />
            </div>
        </Col>
    ))
}

                    

                </Row>


            </Container >
        </div>
    )
}

